import {BrowserRouter, Switch, Route} from "react-router-dom";
import Navbar from "./components/layout/Navbar";

const Router = () =>{
    return(
        <>
            <BrowserRouter>
                <Navbar />
                <Switch>
                    <Route exact path="/">
                        HOME
                    </Route>
                    <Route exact path="/register">
                        <Register />
                    </Route>
                    <Route exact path="/login">
                        LOGIN
                    </Route>
                    <Route exact path="/customer">
                        CUSTOMER
                    </Route>
                </Switch>
            </BrowserRouter>
        </>
    );
}
export default Router;
